pragma solidity ^0.4.24;

contract myCrpytoBox {

    address owner;
    mapping(address => string) public corporation;

    event Send(address from, address to, string indexed boxId);

    constructor() public {
        owner = msg.sender;
    }

    function transfer(address _from, address _to, string _boxId) public returns (bool){

        emit Send(_from, _to, _boxId);

        return true;
    }

    function register(string _description) public returns (bool){
        corporation[msg.sender] = _description;

    }
}
